import React from 'react';
import styled from 'styled-components';

const Nav = styled.nav`
    width: 100%;
    height: 55px;
    border-bottom: 2px solid #f1f1f1;
    padding: 0 20px;
    display: flex;
    justify-content: space-between;

    .logo {
        padding: 15px 0;
    }

    ul {
        list-style: none;
        display: flex;
        flex-flow: row nowrap;
    }

    li {
        padding: 18px 10px;
    }
`

const Navbar = () => {
  return (
      <div className="navbar">
        <div className="logo">
            Nav Bar
        </div>
      </div>
  )
}

export default Navbar
